import React from "react";
import { Redirect, Switch } from "react-router-dom";
import { BatchRoutePage } from "./Batch Preparation/BatchRoutePage";
import { ContentRoute } from "../../../_metronic/layout";

export default function Production() {
  return (
    <Switch>
      <Redirect
        exact={true}
        from="/production"
        to="/production/batch-preparation"
      />
      {/* Inputs */}
      <ContentRoute from="/production/batch-preparation" component={BatchRoutePage} />
    </Switch>
  );
}
